Português estruturado;
Variáveis e Constantes;
Estrutura Sequencial;
Estrutura Condicional (Se e Caso);
Estrutura de Repetição (Enquanto, Repita e Para);
Matrizes;
Listas (Pilha e Fila) - (FIFO e LIFO);
Listas Estáticas e Encadeadas;
Árvores Binárias (Inserção, Exclusão, Pesquisa e ordenação);
